import React from 'react';
import { BrowserRouter, Route, Rout } from 'react-router-dom';
import ExcelUpload from './components/ExcelUpload';
import FilterList from './components/FilterList';
import DataAnalysis from './components/DataAnalysis';
import LoginPage from './components/LoginPage';

function App() {
  return (
    <BrowserRouter>
        <Route path="/" exact component={LoginPage} />
        <Route path="/upload" exact component={ExcelUpload} />
        <Route path="/filters" exact component={FilterList} />
        <Route path="/analysis"  exact component={DataAnalysis} />
    </BrowserRouter>
  );
}

export default App;
